-- ----------------------------
--  Table structure for `crm_admin_role`
-- ----------------------------
DROP TABLE IF EXISTS `crm_admin_role`;
CREATE TABLE `crm_admin_role` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `admin_id` bigint(20) NOT NULL COMMENT '管理员id',
  `role_id` bigint(20) NOT NULL COMMENT '角色id',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识 0 否 1 是',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='管理员角色关联表';

