-- ----------------------------
--  Table structure for `crm_allocation_log`
-- ----------------------------
DROP TABLE IF EXISTS `crm_allocation_log`;
CREATE TABLE `crm_allocation_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `allo_type` tinyint(4) NOT NULL COMMENT '1 表示线索\r\n            2 表示商机',
  `target_id` bigint(20) DEFAULT NULL COMMENT '由allo_type类型决定',
  `allo_source` bigint(20) NOT NULL COMMENT '分配来源id',
  `allo_admin` bigint(20) DEFAULT NULL COMMENT '操作人',
  `allo_owner` bigint(20) DEFAULT NULL COMMENT '归属人',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_crm_allocation_log_is_del` (`is_del`),
  KEY `idx_crm_allocation_log_target_id` (`target_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6243 DEFAULT CHARSET=utf8 COMMENT='线索商机分配记录表';

-- ----------------------------
--  Table structure for `crm_auth`
-- ----------------------------
DROP TABLE IF EXISTS `crm_auth`;
CREATE TABLE `crm_auth` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `auth_code` int(11) NOT NULL COMMENT '权限code',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '权限父节点',
  `auth_name` varchar(32) NOT NULL COMMENT '权限名称',
  `auth_type` tinyint(4) DEFAULT NULL COMMENT '权限类型 1 菜单权限 2 按钮权限',
  `auth_desc` varchar(256) DEFAULT NULL COMMENT '权限描述',
  `auth_url` varchar(64) DEFAULT NULL COMMENT '权限url',
