-- ----------------------------
--  Table structure for `crm_autharea`
-- ----------------------------
DROP TABLE IF EXISTS `crm_autharea`;
CREATE TABLE `crm_autharea` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `cont_id` bigint(20) NOT NULL COMMENT '合同id',
  `province_id` int(11) DEFAULT NULL COMMENT '省',
  `city_id` int(11) DEFAULT NULL COMMENT '市',
  `area_id` int(11) DEFAULT NULL COMMENT '区县',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='合同产品授权区域表';

-- ----------------------------
--  Table structure for `crm_busi_product`
-- ----------------------------
DROP TABLE IF EXISTS `crm_busi_product`;
CREATE TABLE `crm_busi_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `busi_id` bigint(20) NOT NULL COMMENT '商机id',
  `prod_id` bigint(20) DEFAULT NULL COMMENT '产品id',
  `prod_version_id` bigint(20) DEFAULT NULL COMMENT '产品套餐ID',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8 COMMENT='商机产品套餐关联表';

-- ----------------------------
--  Table structure for `crm_business`
-- ----------------------------
DROP TABLE IF EXISTS `crm_business`;
CREATE TABLE `crm_business` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `clue_id` bigint(20) NOT NULL COMMENT '线索id',
  `busi_number` varchar(11) NOT NULL COMMENT '商机编号',
  `num_code` tinyint(3) NOT NULL COMMENT '编号自增码',
  `busi_regitime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '注册时间',
  `busi_status` tinyint(4) DEFAULT NULL COMMENT '商机状态 0已关闭；1审核中；2退回修改；3活动商机;4生成合同',
  `busi_source` tinyint(4) DEFAULT NULL COMMENT '商机来源 1 系统分单 ；2朋友介绍；3 陌生拜访；4领导分单；5老客户介绍；6 同时分单；7离职员工介绍',
  `admin_id` bigint(20) DEFAULT NULL COMMENT '录入人',
  `admin_name` varchar(32) DEFAULT NULL COMMENT '录入人姓名',
  `owner` bigint(20) DEFAULT NULL COMMENT '当前归属人',
  `owner_name` varchar(32) DEFAULT NULL COMMENT '当前归属人姓名',
  `busi_type` tinyint(4) DEFAULT NULL COMMENT '商机类型 1咨询代理；2咨询产品',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `return_change_remark` varchar(255) DEFAULT NULL COMMENT '退回修改备注',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `allot_time` timestamp NULL DEFAULT NULL COMMENT '商机分配时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 COMMENT='商机管理表';

-- ----------------------------
--  Table structure for `crm_callback`
-- ----------------------------
DROP TABLE IF EXISTS `crm_callback`;
CREATE TABLE `crm_callback` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `target_id` bigint(20) NOT NULL COMMENT '线索id',
  `admin_id` bigint(20) NOT NULL COMMENT '回访人',
  `call_content` varchar(256) DEFAULT NULL COMMENT '回访内容',
  `call_bargain` tinyint(4) DEFAULT NULL COMMENT '成交意向',
  `rele_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '回访类型 1 线索回访 ； 2 商机回访',
  `call_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '回访时间',
  `call_next_time` timestamp NULL DEFAULT NULL COMMENT '下次回访时间',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_crm_callback_on_target_id` (`target_id`)
) ENGINE=InnoDB AUTO_INCREMENT=474272 DEFAULT CHARSET=utf8 COMMENT='线索回访表';

-- ----------------------------
--  Table structure for `crm_clue`
-- ----------------------------
DROP TABLE IF EXISTS `crm_clue`;
CREATE TABLE `crm_clue` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `clue_id` bigint(20) DEFAULT NULL COMMENT '老Admin系统线索ID',
  `clue_number` varchar(16) NOT NULL COMMENT '线索编号',
  `num_code` int(11) DEFAULT NULL COMMENT '编号自增码',
  `clue_source` tinyint(4) DEFAULT NULL COMMENT '线索来源',
  `clue_know` tinyint(4) DEFAULT NULL COMMENT '了解方式',
  `clue_consult` tinyint(4) DEFAULT NULL COMMENT '咨询方式',
  `clue_type` tinyint(4) DEFAULT NULL COMMENT '线索类型',
  `clue_status_online` tinyint(4) DEFAULT '0' COMMENT '线索状态 0;未分配；1 已分配 ；2 已关闭；3 退回修改;4，成功关闭',
  `clue_keyword` varchar(64) DEFAULT NULL COMMENT '关键字',
  `admin_id` bigint(20) DEFAULT NULL COMMENT '录入人',
  `admin_name` varchar(32) DEFAULT NULL COMMENT '录入人姓名',
  `owner` bigint(20) DEFAULT NULL COMMENT '归属人',
  `owner_name` varchar(32) DEFAULT NULL COMMENT '归属人姓名',
  `owner_type` tinyint(4) DEFAULT '0' COMMENT '线索归属类型 0 归属用户 1 归属代理商',
  `cust_name` varchar(255) DEFAULT NULL COMMENT '客户名称',
  `cust_addr` varchar(128) DEFAULT NULL COMMENT '客户详细地址',
  `cust_province` int(11) DEFAULT NULL COMMENT '所属省份',
  `cust_city` int(11) DEFAULT NULL COMMENT '所属城市',
  `cust_area` int(11) DEFAULT NULL COMMENT '所属区域',
  `is_callback` bit(1) DEFAULT b'0' COMMENT '是否回访',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `return_change_remark` varchar(255) DEFAULT NULL COMMENT '退回修改备注',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time_long` int(11) DEFAULT NULL COMMENT '创建时间（格林尼治时间）',
  `allot_time` timestamp NULL DEFAULT NULL COMMENT '线索分配时间',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `inx_crm_clue_create_time_long` (`create_time_long`)
) ENGINE=InnoDB AUTO_INCREMENT=281580 DEFAULT CHARSET=utf8 COMMENT='线索表';

-- ----------------------------
--  Table structure for `crm_clue_product`
-- ----------------------------
DROP TABLE IF EXISTS `crm_clue_product`;
CREATE TABLE `crm_clue_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `clue_id` bigint(20) NOT NULL COMMENT '线索id',
  `product_id` bigint(20) NOT NULL COMMENT '产品id',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `clue_id` (`clue_id`),
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=239659 DEFAULT CHARSET=utf8 COMMENT='CRM线索产品关联表';

-- ----------------------------
--  Table structure for `crm_cont_product`
-- ----------------------------
DROP TABLE IF EXISTS `crm_cont_product`;
CREATE TABLE `crm_cont_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `cont_id` bigint(20) NOT NULL COMMENT '合同id',
  `prod_id` bigint(20) NOT NULL COMMENT '产品id',
  `vers_id` bigint(20) unsigned DEFAULT NULL COMMENT '套餐id',
  `actual_amount` decimal(10,0) DEFAULT NULL COMMENT '实际金额',
  `buy_count` int(11) DEFAULT NULL COMMENT '购买数量',
  `prod_discount` varchar(5) DEFAULT NULL COMMENT '折扣',
  `sum_menday` int(11) DEFAULT NULL COMMENT '总人天',
  `price_menday` decimal(10,0) DEFAULT NULL COMMENT '人天单价',
  `acc_try_period` int(11) DEFAULT NULL COMMENT '试用周期',
  `acc_try_count` int(11) DEFAULT NULL COMMENT '试用账号数量',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='合同产品关联表';

-- ----------------------------
--  Table structure for `crm_contract`
-- ----------------------------
DROP TABLE IF EXISTS `crm_contract`;
CREATE TABLE `crm_contract` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `busi_id` bigint(20) NOT NULL COMMENT '商机id',
  `cont_number` varchar(13) NOT NULL COMMENT '合同编号',
  `num_code` tinyint(3) DEFAULT NULL COMMENT '编号自增码',
  `cont_signtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '签订日期',
  `cont_type` tinyint(4) DEFAULT NULL COMMENT '合同类型',
  `cont_status` tinyint(4) DEFAULT NULL COMMENT '合同状态 1审核中；2合同通过；3合同作废',
  `agent_level` tinyint(4) DEFAULT NULL COMMENT '代理商级别 1普代 ；2总代；3三方代理；4微客生活；5试行',
  `cont_service_level` tinyint(4) DEFAULT NULL COMMENT '服务级别  1普通；2铜牌；3银牌；4金牌；5新代理；6休眠；7终止；8纠纷代理',
  `cont_category` tinyint(4) DEFAULT NULL COMMENT '类别 1微客来代理；2百拓代理商；3微电商代理商；4红包代理商',
  `cont_validity_date` date DEFAULT NULL COMMENT '有效期',
  `cont_receivable` decimal(10,0) DEFAULT NULL COMMENT '应收款',
  `cont_collected` decimal(10,0) DEFAULT NULL COMMENT '已收款',
  `cont_uncollected` decimal(10,0) DEFAULT NULL COMMENT '未收款',
  `acc_status` tinyint(1) DEFAULT '0' COMMENT '账号开通状态 0 未开通 1 已开通',
  `cont_accessory_name` varchar(128) DEFAULT NULL COMMENT '合同附件名称',
  `cont_remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='合同管理表';

-- ----------------------------
--  Table structure for `crm_contract_file`
-- ----------------------------
DROP TABLE IF EXISTS `crm_contract_file`;
CREATE TABLE `crm_contract_file` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT,
  `file_type` tinyint(4) NOT NULL COMMENT '附件类型 0 合同附件',
  `target_id` bigint(32) NOT NULL COMMENT '目标ID，根据file_type 附件类型有所不同',
  `file_name` varchar(255) DEFAULT NULL COMMENT '文件真实名称',
  `file_name_random` varchar(255) DEFAULT NULL COMMENT '文件随机名称（防止文件名重复）',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `crm_customer`
