-- ----------------------------
--  Procedure structure for `contractPaths`
-- ----------------------------
DROP PROCEDURE IF EXISTS `contractPaths`;
delimiter ;;
CREATE DEFINER=`crm_admin`@`%` PROCEDURE `contractPaths`()
BEGIN
	DECLARE contractId INT;
	DECLARE accessoryName VARCHAR(255);

	DECLARE done INT DEFAULT FALSE;
	DECLARE clue_cur CURSOR FOR SELECT cc.id,cc.cont_accessory_name FROM crm_contract cc WHERE cc.cont_accessory_name IS NOT NULL;

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	OPEN clue_cur;
			emp_loop: LOOP
				IF done THEN
					SELECT '更新成功';
					LEAVE emp_loop;
				END IF;
				FETCH clue_cur INTO contractId,accessoryName;
				INSERT INTO crm_contract_file(file_type,target_id,file_name,created_at,updated_at)VALUES(0,contractId,accessoryName,NOW(),NOW());
				UPDATE crm_contract SET cont_accessory_name = NULL WHERE id = contractId;
			END LOOP;
	CLOSE clue_cur;
END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getChildList`
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildList`;
delimiter ;;
CREATE DEFINER=`crm_admin`@`%` FUNCTION `getChildList`(rootId BIGINT(32)) RETURNS varchar(1000) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempChd VARCHAR(1000);

    SET sTemp = '$';
	SELECT ca.admin_dep INTO sTempChd FROM crm_admin ca WHERE ca.id = rootId;

    WHILE sTempChd IS NOT NULL DO
      SET sTemp = CONCAT(sTemp, ',', sTempChd);
      SELECT
        GROUP_CONCAT(id)
      INTO sTempChd
      FROM crm_dep
      WHERE FIND_IN_SET(CAST(parent_id AS CHAR), sTempChd) > 0;
    END WHILE;
    RETURN sTemp;
  END
 ;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
